import sys
import unittest
from functools import cache

null = None


sys.setrecursionlimit(5000)


class Solution:
    def deleteString(self, s: str) -> int:
        n = len(s)

        dp = [-1] * n
        dp[n-1] = 1

        def dfs(index: int):
            if dp[index] != -1:
                return dp[index]

            half = (n - index) // 2

            ans = 1
            for i in range(1, half+1):
                same = True
                for j in range(i):
                    if s[index+j] != s[index+i+j]:
                        same = False
                        break

                if same:
                    ans = max(ans, dfs(index+i) + 1)
                if ans == n - index:
                    break

            dp[index] = ans
            return ans

        return dfs(0)


def test(testObj: unittest.TestCase, s: str, expected: int) -> None:

    so = Solution()

    actual = so.deleteString(s)

    testObj.assertEqual(actual, expected)


class TestClass(unittest.TestCase):

    def test_1(self):
        test(self,   "abcabcdabc", 2)

    def test_2(self):
        test(self,   "aaabaab", 4)

    def test_3(self):
        test(self,   "aaaaa", 5)

    def test_4(self):
        test(self,   "", 4000)

    def test_100a(self):
        test(self,   "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa", 100)


if __name__ == '__main__':
    unittest.main()

